import React, { useState } from 'react';

const App = () => {
  const [cont, setCont] = useState(0);
  return (
    <React.Fragment>
      <h2>Contador</h2>
      <button onClick={() => setCont(cont + 1)}>{cont}</button>
    </React.Fragment>
  );
};

export default App;
